import React from "react";
import styled from "styled-components";
import { useMocks } from "../context/mock-context";
import { Wrapper } from "../styled/space";
import { ManifestLabor, MediumSubtitle } from "../styled/typos";

const Manifeste = () => {
  const { manifeste } = useMocks();
  console.log(manifeste);
  return (
    <Wrapper>
      <FirstPart>
        <Fixed>
          <MediumSubtitle>{manifeste.title}</MediumSubtitle>
        </Fixed>
        <ManifestLabor>{manifeste.content}</ManifestLabor>
      </FirstPart>
    </Wrapper>
  );
};
export default Manifeste;

const Fixed = styled.div`
  width: 40%;
  h4 {
    transform: translate(180deg);
    position: relative;
  }
`;
const FirstPart = styled.div`
  position: relative;
  display: flex;
  justify-content: space-around;
  flex-direction: row;
  background-color: ${props => props.theme.colors.black};
  p {
    width: 100%;
  }
`;
